import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="header">
      <div className="row">
        <div className="col-md-8" style={{ backgroundColor: "red" }}>
          <h2>Django, React, MongoDB Crud Application</h2>
        </div>
        <div
          className="col-md-4"
          style={{ backgroundColor: "green", textAlign: "right" }}
        >
          <div className="row">
            <Link to="/login" className="nav-link col-md-1">
              Signup
            </Link>
            <Link to="/signup" className="nav-link col-md-3">
              Login
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
